    FROM sys.default_constraints
    WHERE parent_object_id = object_id(N'dbo.Events')
    AND col_name(parent_object_id, parent_column_id) = 'TagString';
    IF @var0 IS NOT NULL
        EXECUTE('ALTER TABLE [dbo].[Events] DROP CONSTRAINT [' + @var0 + ']')
    ALTER TABLE [dbo].[Events] DROP COLUMN [TagString]
    DECLARE @var1 nvarchar(128)
    SELECT @var1 = name
    FROM sys.default_constraints
    WHERE parent_object_id = object_id(N'dbo.Samples')
    AND col_name(parent_object_id, parent_column_id) = 'TagString';
    IF @var1 IS NOT NULL
        EXECUTE('ALTER TABLE [dbo].[Samples] DROP CONSTRAINT [' + @var1 + ']')
    ALTER TABLE [dbo].[Samples] DROP COLUMN [TagString]
    INSERT [dbo].[__MigrationHistory]([MigrationId], [ContextKey], [Model], [ProductVersion])
    VALUES (N'201801181433192_removeTagString', N'Silica.DataAccess.EF.Migrations.Configuration',   , N'6.1.3-40302')
END

